Team,

I am getting a crash when trying to enable crypto on iOS side using the SDK.

``` 
let credentials = MXCredentials(homeServer: "http://matrix.org",
                                userId: "@your_user_id:matrix.org",
                                accessToken: "your_access_token")
//Edit that resolved the first crash
credentials.deviceId = device_id

// Create a matrix client
let mxRestClient = MXRestClient(credentials: credentials, unrecognizedCertificateHandler: nil)

// Create a matrix session
let session = MXSession(matrixRestClient: mxRestClient) 

// enable crypto
if session.crypto == nil {
            session.enableCrypto(true) { response in
                if response.isSuccess {
                    print("crypto is enabled")
                } else {
                    print("something went wrong")
                }
            }
        }


```

This is the error getting printed when trying the above code.
[MXCryptoV2Factory] buildCrypto(session:migrationProgress:success:failure:): Missing required dependencies

Is there a way to resolve this issue. I am new to matrix. If the above process is not right can an example code be provided for the same.

Thanks.

